// SPDX-License-Identifier: MIT
pragma solidity 0.6.9;

pragma experimental ABIEncoderV2;

contract ContractA {

  mapping (uint256 => Vault) vaults;

  struct Vault{
    uint256 a;
    uint256 b;
  }
  constructor() public {
    Vault memory vault = Vault(5, 10);
    vaults[1] = vault;
  }

  function updateVault(Vault memory finalVault) external {
    vaults[1] = finalVault;
  }

  function getVault(uint256 id) external view returns (Vault memory) {
    return vaults[id];
  }

}
